// import { nameService } from '../services/name.service.js';

export function setMediaLink(mediaLink) {
    console.log('action mediaLink', mediaLink);
    return async dispatch => {
        try {
            dispatch({
                type: 'SET_MEDIA_LINK',
                mediaLink
            });
        } catch (err) {
            console.log('Name Actions: err in loaded Names', err);
        }
    };
}
export function setMediaType(mediaName) {
    console.log('action mediaName', mediaName);
    return async dispatch => {
        try {
            dispatch({
                type: 'SELECTED_MEDIA_TYPE',
                mediaName
            });
        } catch (err) {
            console.log('Name Actions: err in loaded Names', err);
        }
    };
}
export function setOrderDetails(orderDetails) {
    console.log('action orderDetails', orderDetails);
    return async dispatch => {
        try {
            dispatch({
                type: 'SET_ORDER',
                orderDetails
            });
        } catch (err) {
            console.log('Actions: err in set order', err);
        }
    };
}

export function orderCompleted(orderDetails) {
   return console.log('action orderDetails completed', orderDetails);
}
